const Main = ({history}) =>{
    if(!history.location.state){
        window.location.href = "http://localhost:3000/";
    }

    const UserAuth = history.location.state
   
    return (
        <Structure>
    
            <Welcome name={UserAuth.user.name}/>
             
                <div className='charts'>
               
                </div>
            
        </Structure>
    )
}

export default Main
